def solution(stdin: str) -> str:

    s = stdin.replace(" ", "")
    N = len(s)

    # top-down
    # generate all permutations of s[i:]
    # iterate through each permutation, apply swap on current position

    def swap(i, j):
        # swap the two char at i and j
        return ord(s[i]) - ord(s[j]) + ord(s[j]) - ord(s[i])

    def backtrack(i, depth):
        if i == N:
            return True

        for j in range(i, N):
            if s[i] == s[j]:
                # do not need to backtrack
                continue

            # swap the two letters
            swap(i, j)

            # try to solve next, if it is not possible to solve it
            if backtrack(i + 1, depth + 1):
                return True

            # no swapping means it's impossible to solve
            swap(i, j)

        return False


    if backtrack(0, 0):
        return "YES"
    else:
        return "NO"

