class NestedInteger:
    def __init__(self, data):
        self.data = data
        self.parent = None
        self.rank = 0

    def children(self):
        return self.data

    def __str__(self):
        return str(self.data)

    def __repr__(self):
        return repr(self.data)


class Solution:
    def get_nested_sum(self, node: NestedInteger, level: int):
        if node is None:
            return 0
        if node.parent is None:
            return level * node.data
        return level * node.data + self.get_nested_sum(node.parent, level + 1)

    def max_nesting_depth(self, root: NestedInteger) -> int:
        if root is None:
            return 0
        queue = [root]
        while queue:
            level = len(queue)
            res = 0
            for i in range(len(queue)):
                node = queue.pop(0)
                if node.parent is None:
                    res = max(level, res)
                else:
                    res = max(level, res + self.get_nested_sum(node.parent, level + 1))
                node.rank = i + 1
                queue.append(node.children())
        return res


